it('schedules a 10-second timer after 1 second', () => {
  jest.spyOn(globalThis, 'setTimeout');

  const infiniteTimerGame = require('../infiniteTimerGame');

  const callback = jest.fn();
  infiniteTimerGame(callback); // At this point in time, there should have been a single call to
  // setTimeout to schedule the end of the game in 1 second.

  expect(setTimeout).toBeCalledTimes(1);
  expect(setTimeout).toHaveBeenNthCalledWith(1, expect.any(Function), 1000); // Fast forward and exhaust only currently pending timers
  // (but not any new timers that get created during that process)

  jest.runOnlyPendingTimers(); // At this point, our 1-second timer should have fired its callback

  expect(callback).toBeCalled(); // And it should have created a new timer to start the game over in
  // 10 seconds

  expect(setTimeout).toBeCalledTimes(2);
  expect(setTimeout).toHaveBeenNthCalledWith(2, expect.any(Function), 10000);
});

it('waits 1 second before ending the game', () => {
  const timerGame = require('../timerGame');

  timerGame();
  expect(setTimeout).toBeCalledTimes(1);
  expect(setTimeout).toBeCalledWith(expect.any(Function), 1000);
});

it('calls the callback after 1 second via runAllTimers', () => {
  const timerGame = require('../timerGame');

  const callback = jest.fn();
  timerGame(callback); // At this point in time, the callback should not have been called yet

  expect(callback).not.toBeCalled(); // Fast-forward until all timers have been executed

  jest.runAllTimers(); // Now our callback should have been called!

  expect(callback).toBeCalled();
  expect(callback).toBeCalledTimes(1);
});

it('calls the callback after 1 second via advanceTimersByTime', () => {
  const timerGame = require('../timerGame');

  const callback = jest.fn();
  timerGame(callback); // At this point in time, the callback should not have been called yet

  expect(callback).not.toBeCalled(); // Fast-forward until all timers have been executed

  jest.advanceTimersByTime(1000); // Now our callback should have been called!

  expect(callback).toBeCalled();
  expect(callback).toBeCalledTimes(1);
});

